import classes from "./LeftImageRightText.module.css";
import bookAppointment from "./about1.png";


function LeftImageRightText() {
  return (
    <div className={classes.LeftImageRightTextParent}>
      <div className={classes.websiteContent2}>
        <img
          className={classes.HomeImageContainer2}
          src={bookAppointment}
          alt="logo"
        ></img>

        <div className={classes.detailContainer2}>
          <div className={classes.aboutHeading1}>Empowerment</div>

          <div className={classes.aboutHeading2}> 
	     Trident Galaxy 
	     is more than just a residence; 
	     it's a lifestyle 
	  </div>

          <div className={classes.aboutDetails}>
	    Our association serves as the catalyst that transforms living spaces into nurturing homes and neighbors into lifelong friends. With a range of meticulously planned initiatives, from recreational activities that rejuvenate the soul to educational workshops that expand the mind, we strive to cater to the diverse interests and needs of our esteemed residents. As a member of the Trident Galaxy Residents Welfare Association, you'll find yourself immersed in a vibrant community where your voice matters, your ideas are valued, and your aspirations are supported. Together, we build not only a thriving residential complex but a shared haven we all proudly call home.
          </div>
        </div>
      </div>
    </div>
  );
}

export default LeftImageRightText;
